export default class extends React.Component {
  render() {
    return (
      <React.Fragment>
        <h1>Podcasts</h1>
        <style>
          {`
           color : #fff;
           background  : #8756ca;
           text-align:center;
          `}
        </style>
      </React.Fragment>
    );
  }
}
